import navigationItems from '../NavigationItems/navigationItems';
import classes from './sideBar.module.css';

const sideBar = (props)=>(

    <div className={classes.SideBar}>
        <navigationItems clicked={props.clicked}/>
    </div>
)

export default sideBar;
